import React from 'react';
import ProfileEdit from './ProfileEdit'

export default function Profile(){
    return(
    <div className="relative w-3/4 z-20 mx-auto">
        <div className="bg-sky-900 flex flex-row items-center w-3/4 h-64 mx-auto rounded-xl mb-7 relative">
            <div className="flex flex-row align-items">
                <img className="h-32" src="https://cdn-icons-png.flaticon.com/512/3135/3135715.png"/>
            </div>
        </div>
    </div>
    )
}
